import SingleWhiskeyRating from "@/components/Whiskey/SingleWhiskeyRating.vue";
export default {
  components: {
    SingleEvent: SingleEvent,
    CheckIn: CheckIn,
    TileFormat: TileFormat,
    SingleWhiskeyRating: SingleWhiskeyRating
  },
  name: "WhiskeyRatingList",
  props: {
    eventId: null,
    whiskeyRating: {
      whiskeyId: Number,
      userId: Number,
      eventId: Number,
      tasteRating: Number,
      smellRating: Number,
      colorRating: Number,
      bodyRating: Number,
      finishRating: Number,
      priceRating: Number,
      overallRating: Number
    }
  },
  event: {
    title: String,
    imgUrl: String,
    date: new Date(),
    time: String,
    location: String,
    eventDescription: "",
    isBlindTasting: true // eventId: Number

  },
  created: function created() {
    this.listWhiskeyRatings();
  },
  data: function data() {
    return {
      numOfWhiskeys: "",
      numOfReviewers: "",
      whiskeyList: [],
      whiskeyRatingList: [],
      whiskeyBrandList: [],
      whiskeyReviewerList: [],
      whiskeyApiURL: "http://localhost:8080/AuthenticationApplication/api/event/",
      whiskeyRatingApiUrl: "http://localhost:8080/AuthenticationApplication/api/event/",
      tasteRatingPercentage: "",
      smellRatingPercentage: "",
      colorRatingPercentage: "",
      bodyRatingPercentage: "",
      finishRatingPercentage: "",
      priceRatingPercentage: "",
      overallRatingPercentage: "",
      widths: {
        tasteRatingWidth: "",
        smellRatingWidth: "",
        colorRatingWidth: "",
        bodyRatingWidth: "",
        finishRatingWidth: "",
        priceRatingWidth: "",
        overallRatingWidth: ""
      },
      sumTasteRating: "",
      sumSmellRating: "",
      sumColorRating: "",
      sumBodyRating: "",
      sumFinishRating: "",
      sumPriceRating: "",
      sumOverallRating: "",
      aveWhiskeyRating: {
        aveTasteRating: "",
        aveSmellRating: "",
        aveColorRating: "",
        aveBodyRating: "",
        aveFinishRating: "",
        avePriceRating: "",
        aveOverallRating: ""
      },
      whiskeyId: 9
    };
  },
  methods: {
    listWhiskeyRatings: function listWhiskeyRatings() {
      var _this = this;

      fetch(this.whiskeyRatingApiUrl + this.eventId + "/whiskeyRating/" + this.whiskeyId).then(function (response) {
        console.log(response);
        return response.json();
      }).then(function (jsonList) {
        _this.whiskeyRatingList = jsonList;

        _this.doAllCalculations();
      }).catch(function (err) {
        return console.error(err);
      });
    },
    countReviews: function countReviews() {
      this.numOfReviewers = this.whiskeyRatingList.length;
    },
    getAveragesOfAllRatings: function getAveragesOfAllRatings() {
      this.aveWhiskeyRating.aveTasteRating = this.sumTasteRating / this.numOfReviewers;
      this.aveWhiskeyRating.aveSmellRating = this.sumSmellRating / this.numOfReviewers;
      this.aveWhiskeyRating.aveColorRating = this.sumColorRating / this.numOfReviewers;
      this.aveWhiskeyRating.aveBodyRating = this.sumBodyRating / this.numOfReviewers;
      this.aveWhiskeyRating.aveFinishRating = this.sumFinishRating / this.numOfReviewers;
      this.aveWhiskeyRating.avePriceRating = this.sumPriceRating / this.numOfReviewers;
      this.aveWhiskeyRating.aveOverallRating = this.sumOverallRating / this.numOfReviewers;
    },
    getPercentagesOfAllRatings: function getPercentagesOfAllRatings() {
      this.tasteRatingPercentage = this.aveWhiskeyRating.aveTasteRating / 5 * 10;
      this.smellRatingPercentage = this.aveWhiskeyRating.aveSmellRating / 5 * 10;
      this.colorRatingPercentage = this.aveWhiskeyRating.aveColorRating / 5 * 10;
      this.bodyRatingPercentage = this.aveWhiskeyRating.aveBodyRating / 5 * 10;
      this.finishRatingPercentage = this.aveWhiskeyRating.aveFinishRating / 5 * 10;
      this.priceRatingPercentage = this.aveWhiskeyRating.avePriceRating / 5 * 10;
      this.overallRatingPercentage = this.aveWhiskeyRating.aveOverallRating / 5 * 10;
    },
    getRatingWidths: function getRatingWidths() {
      this.widths.tasteRatingWidth = "width: " + this.tasteRatingPercentage + "%";
      this.widths.smellRatingWidth = "width: " + this.smellRatingPercentage + "%";
      this.widths.colorRatingWidth = "width: " + this.colorRatingPercentage + "%";
      this.widths.bodyRatingWidth = "width: " + this.bodyRatingPercentage + "%";
      this.widths.finishRatingWidth = "width: " + this.finishRatingPercentage + "%";
      this.widths.priceRatingWidth = "width: " + this.priceRatingPercentage + "%";
      this.widths.overallRatingWidth = "width: " + this.overallRatingPercentage + "%";
    },
    doAllCalculations: function doAllCalculations() {
      var _this2 = this;

      this.whiskeyRatingList.forEach(function (whiskeyRating) {
        _this2.sumTasteRating += whiskeyRating.tasteRating;
        _this2.sumSmellRating += whiskeyRating.smellRating;
        _this2.sumColorRating += whiskeyRating.colorRating;
        _this2.sumBodyRating += whiskeyRating.bodyRating;
        _this2.sumFinishRating += whiskeyRating.finishRating;
        _this2.sumPriceRating += whiskeyRating.priceRating;
        _this2.sumOverallRating += whiskeyRating.overallRating;

        _this2.countReviews(whiskeyRating);

        _this2.getAveragesOfAllRatings();

        _this2.getPercentagesOfAllRatings();

        _this2.getRatingWidths();
      });
    }
  }
};
